import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Type a number on the whiteboard and click enter.</p>
        <p></p> className="App-logo" alt="Whiteboard Here" <p/>
      </header>
    </div>
  );
}

export default App;
